import React from "react";
import { DimensionValue, StyleSheet } from "react-native";

export const style = (width : DimensionValue, height : DimensionValue) => StyleSheet.create({
    container: {
        backgroundColor: '#0c0f2d',
        width: width,
        height: '5vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center'
    },
    ftext: {
        color: 'white'
    }
})
